import React from 'react'
import styles from '../elements_CSS/CardDetail.module.css'

export const Details = ({id, name, continent, image, capital, subregion, area, activities})=>{
    const style = {
        backgroundImage:`url(${image})`,
        backgroundRepeat: 'no-repeat',
        backgroundPosition: 'center',
        backgroundSize: 'cover'
    }
    return(
        <div style={style} className={styles.container}>
        <h3>name : {name}</h3>
        <h5>countryCode : {id}</h5>
        <h5>continent : {continent}</h5>
        <h5>capital : {capital}</h5>
        <h5>subregion : {subregion}</h5>
        <h5>area : {area}</h5>
        <h5>activities : {activities.map((el)=>el.map((el)=><div key={el.id}>
                                                                 {el.name}
        </div>))}</h5>


    </div>
    )
}
